One key feature of dipa is the #[derive(DiffPatch)] macro that allows you to implement delta compression without the tedious and hard to maintain process of writing the necessary data structures and logic by hand. Here's a quick look at dipa in action. use dipa::DiffPatch; #[derive(DiffPatch)]
struct MyStruct { a_field: MyEnum, another_field: i32, one_more: Vec<MyOtherStruct>
} #[derive(DiffPatch)]
enum MyEnum { A(u8), B(u16, Vec<f32>), C { set: HashSet<u128> },
} #[derive(DiffPatch)]
struct MyOtherStruct(u64, BTreeMap<i8, MyEnum>); fn main () { let old = MyStruct { a_field: MyEnum::B(308, vec![1., 2.]), another_field: -10, one_more: vec![MyOtherStruct(7, BTreeMap::new())] }; let new = MyStruct { a_field: MyEnum::A(10), another_field: 650, one_more: vec![MyOtherStruct(567, BTreeMap::new())] }; let diff = old.create_delta_towards(&new); let serialized = bincode::options() .with_varint_encoding() .serialize(&diff) .unwrap(); // ... Pretend we sent the bytes over a network ... let deserialized: <MyStructDiff as dipa::Diffable<'_, MyStructDiff>>::DeltaOwned = bincode::options() .with_varint_encoding() .deserialize(&serialized) .unwrap(); let mut old = old; old.apply_patch(deserialized); // old is now equal to new.
}

